function tnt_readCookie(name) {
  return (name = new RegExp('(?:^|;\\s*)' + ('' + name).replace(/[-[\]{}()*+?.,\\^$|#\s]/g, '\\$&') + '=([^;]*)').exec(document.cookie)) && name[1];
}

// pass in aam_tnt val as aamseg mbox param for sites using mbox.js
function mboxParams(isMbox) {
  var aam_tnt_cval = tnt_readCookie("aam_tnt");
  if (aam_tnt_cval) {
    var aam_tnt_cval_array = new Array();
    aam_tnt_cval_array[0] = "aamseg=" + unescape(aam_tnt_cval);
    if (aam_tnt_cval_array) {
      if (isMbox) {
        var tapMboxBuilder = mboxFactoryDefault.getUrlBuilder();
        tapMboxBuilder.addParameters(aam_tnt_cval_array);
      }

      return aam_tnt_cval_array;
    }
  }
}

// pass in aam_tnt val as aamseg mbox param for sites using at.js
// pass in at_property for user permissions
function targetPageParamsAll() {
  // start user permissions
  var at_property = "";
  var host = window.location.hostname, 
    path = window.location.pathname;
    if (host === "www.adobe.com" && (path.indexOf("marketing-cloud") !== -1 || path.indexOf("experience-cloud") !== -1 || path.indexOf("advertising-cloud") !== -1 || path.indexOf("data-analytics-cloud") !== -1)) {
      at_property = "at_property=43a79e86-2b77-ef40-bd3d-82ca2783fc9d";
    } else if (host === "www.adobe.com" && (path.indexOf("photoshop-elements") !== -1 || path.indexOf("photoshop-premiere-elements") !== -1 || path.indexOf("premiere-elements") !== -1 )) {
      at_property = "at_property=d53068e2-4bbc-7eea-a7ca-1ce18dc31fdb";
    } else if (host === "cloud.acrobat.com" || host === "acrobat.adobe.com") {
      at_property = "at_property=a77c9437-77c0-1012-2234-49f047aa80dd";
    } else if (host === "www.adobe.com" || host === "creative.adobe.com" || host === "stock.adobe.com" || host === "helpx.adobe.com" || host === "accounts.adobe.com" || host === "adminconsole.adobe.com") {
      at_property = "at_property=7519f9ed-8af8-596a-460b-f1c9e3e28c47";
    } else if (host === "www.stage.adobe.com" || host === "stage.ccmui.adobe.com" || host === "primary.staging.adobestock.com" || host === "helpx.stage.adobe.com" || host === "stage.acrobat.adobe.com" || host === "stage.accounts.adobe.com" || host === "stage.adminconsole.adobe.com" ) {
      at_property = "at_property=bc8dfa27-29cc-625c-22ea-f7ccebfc6231";
    }  //end user permissions 
  var param_str = at_property;
  var aam_tnt_cval = tnt_readCookie("aam_tnt");
  if (aam_tnt_cval) {
    if (param_str == "") {
      param_str = "aamseg=" + unescape(aam_tnt_cval);
    }
    else {
      param_str += "&aamseg=" + unescape(aam_tnt_cval);
    }
  }
  var tnt_excl = tnt_readCookie("tnt_exclusion_targetCampaigns");
  if (tnt_excl) {
    if (param_str == "") {
      param_str = "tnt_exclusion_targetCampaigns=" + unescape(tnt_excl);
    }
    else {
      param_str += "&tnt_exclusion_targetCampaigns=" + unescape(tnt_excl);
    }
  }
  return param_str; 
}

