function db_tnt_cb(d) {
  if (!d) return '';
  try {
    var p = "";
    for (var key in d) {
      if (d.hasOwnProperty(key)) {
        var a = "profile." + key + "=" + d[key] + ",";
        p += a;
      }
    }
    p = p.split(",");
    var u = mboxFactoryDefault.getUrlBuilder();
    u.addParameters(p)
  } catch (e) {}
}
